import React from 'react';
import NavBar from '../components/NavBar';
import { SettingsNavigation } from '../components/Org/OrgSettingsPage/SettingsNavigation.tsx';
// frontend\src\components\Org\OrgSettingsPage\SettingsNavigation.tsx
import { Text, Container } from '@mantine/core';

import '../styles/SettingsNavigation.module.css';
import '../styles/index.css';

function OrgSettingsPage()
{

    return (
        <div id="OrgProfilePageDiv">
             <link rel="preconnect" href="https://fonts.googleapis.com"/>
             <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin/>
             <link href="https://fonts.googleapis.com/css2?family=Gabarito:wght@400;700&display=swap" rel="stylesheet"></link>

             <header>
                 <h1 id="main-title">Settings Page</h1>
                 <h2 id="sub-title">Currently in Progress!</h2>
             </header>
             <body id="settings-body">

             </body>
            <div id="NavBar">
                <NavBar />
            </div>

            <Text size="xl">Settings Page</Text>

            <div className="settings-navigation">
                <SettingsNavigation />
            </div>
        </div>
        // <Container></Container>
    );
}

export default OrgSettingsPage;
